
#!/usr/bin/env python3
import base64, tempfile, os, sys, stat, subprocess, shutil, zipfile

ZIP_B64 = ""
NAME_IN_ZIP = "Devil64"

PY_LIB_DIR = "/data/data/com.termux/files/usr/lib"

def copy_needed_libs(target):
    libs = [
        "libpython3.11.so.1.0",
        "libandroid-support.so",
        "libz.so",
        "libz.so.1",
    ]
    for lib in libs:
        p = os.path.join(PY_LIB_DIR, lib)
        if os.path.exists(p):
            shutil.copy(p, target)

    dyn = os.path.join(PY_LIB_DIR, "python3.11", "lib-dynload")
    if os.path.isdir(dyn):
        for f in os.listdir(dyn):
            shutil.copy(os.path.join(dyn, f), target)

def main():
    tmp = tempfile.mkdtemp(prefix="devilcore_")

    zip_path = os.path.join(tmp, "package.zip")
    with open(zip_path, "wb") as f:
        f.write(base64.b64decode(ZIP_B64))

    with zipfile.ZipFile(zip_path) as z:
        z.extract(NAME_IN_ZIP, tmp)

    exe = os.path.join(tmp, NAME_IN_ZIP)

    os.chmod(exe, os.stat(exe).st_mode | stat.S_IEXEC)

    copy_needed_libs(tmp)

    env = os.environ.copy()
    env["LD_LIBRARY_PATH"] = tmp

    subprocess.run([exe] + sys.argv[1:], env=env)

    shutil.rmtree(tmp, ignore_errors=True)

if __name__ == "__main__":
    main()
